        {
           type : "text" ,
           content : ['L’assurance habitation est obligatoire pour les locataires, y compris les locataires de logements meublés, et les co-propriétaires (propriétaires d’un lot dans une copropriété). L’obligation d’assurance pour les co-propriétaires se limite à la garantie responsabilité civile envers la copropriété, les voisins et tiers ainsi que les éventuels locataires.']
        }
    ])









